import React, { useEffect, useState } from 'react';
import logo from '../logo.svg';
import $ from 'jquery';
import './MainContainer.css';

function Front() {
  return (
    <div id="front">
      <h3>Welcome</h3>
      <p>We do business here.</p>

      <input className="form-control" id="time" />
      <input className="form-control" id="datetime1" />


      <div className="form-group">
        <div className="input-group date" id='datetime'>
          <input type='text' className="form-control" />
          <span className="input-group-addon">
            <span className="glyphicon glyphicon-calendar"></span>
          </span>
        </div>
      </div>
    </div>
  );
}

class Venue extends React.Component {
  constructor(props) {
    super(props);
    this.id = props.id || null;
    this.o = props;
  }
  render() {
    if (this.id)
      return (
        <div ishidden="false" class="block">
          <div class="img"><img class="rounded" src=")path)/img/venue/)venue.img).jpg" /></div>

          <div class="info">

            <div class="name"><p>{this.o.name}</p></div>
            <div class="address"><p>{this.o.address}</p></div>
            <div class="type"><p>{this.o.type}</p></div>
            <div class="staffname"><p>{this.o.staffname}</p></div>
            <div class="desc"><p>{this.o.desc}</p></div>
            <div class="capacity"><p>{this.o.capacity}</p></div>
            <div class="fee"><p>{this.o.fee}</p></div>

            <div class="book button" t="main" onclick={"toBooking(" + this.id + ")"}><span class="material-symbols-rounded">in_home_mode</span>\n +
              <p>Book</p>\n +
            </div>

            <div class="button time" t="main" onclick="console.log(')venue.getOpenTime())'"><span class="material-symbols-rounded">event_available</span>\n +
              <p>View Opening Hours</p>\n +
            </div>

          </div>

        </div>
      );
    else
      return (<div></div>);
  }
}
function Venues() {
  const [venues, setVenue] = useState(null);

  useEffect(() => {

    fetch("http://localhost:8088/venue/ALL", {
      headers: { "Access-Control-Allow-Origin": "*" }
    })
      .then((response) => {
        console.log('requesting payment intent')
        if (response.status === 200) {
          return response.json()
        }
      }).then((data) => {
        if (data) {
          var result = []
          console.log(data)
          console.log(data['0'])
          for (var i in data)
            result.push([i, data[i]]);
          setVenue(result);
          console.log(result)
        }
      })

  }, []);

  return (<div className='venue'>
    {venues ? venues.map((object) => {
      return new Venue(object).render()
    }) : <div className="empty">There are no avalible venues.</div>}
  </div>);
}

export default function MainContainer() {

  return (
    <div className="main-container">
      <Front />
      <Venues />
    </div>
  )
}
